import React from 'react'
import { GlobalContext } from './GlobalContext'


const Produto = () => {
  const { fetchApi, limparDados } = React.useContext(GlobalContext);

  if(fetchApi !== null) {
  return (
    <div>
      <ul>
        {fetchApi.map((product) => <li key={product.id}>{product.nome}</li>)}
      </ul>

      <button onClick={ limparDados }>Limpar Dados</button>
    </div>
    )
  }
}

export default Produto
